defs.script:
var a2_idx;
var a2_on;
var a2_fr;
var a2_btnPauseLeft,a2_btnPlayLeft,a2_btnPauseRight,a2_btnPlayRight;
var a2_playsRight,a2_isPaused;
var a2_int;
var a2_pause,a2_playRight,a2_playLeft,a2_playBwd,a2_playFwd;
var a2_fps,a2_spd;
var a2_setFps;
var a2_seekFrame,a2_gotoNext,a2_gotoPrev;
var a2_stopFirst,a2_stopLast;
var a2_playPauseBwd,a2_playPauseFwd;
var a2_stepBwd,a2_stepFwd;
var a2_spdIncr,a2_spdDecr,a2_spdReset;
(function(){
function onload(){
if(!a2_fr){
a2_fr=new Array();
a2_on=0;
var ocg=document.getElementsByClassName('ocg');
for(var i=0;i<ocg.length;i++){
var ocgName=ocg[i].getAttribute('id').split('.');
if(ocgName[0]==2){
a2_fr[ocgName[1]]=ocg[i];
}
}
a2_btnPauseLeft=document.getElementById('2.PauseLeft');
a2_btnPlayLeft=document.getElementById('2.PlayLeft');
a2_btnPauseRight=document.getElementById('2.PauseRight');
a2_btnPlayRight=document.getElementById('2.PlayRight');
a2_playsRight=true;
a2_isPaused=false;
a2_playing=false;
a2_fps=2;
a2_spd=1;
a2_setFps=function(f){
a2_fps=(f==0?1e-6:f);
if(a2_playing){
if(a2_playsRight){a2_playRight();}else{a2_playLeft();}
}
};
a2_seekFrame=function(f){
if(f>2||f<0){return -1;}
a2_idx=f;
a2_fr[a2_on].setAttribute('visibility','hidden');
a2_fr[f].setAttribute('visibility','visible');
a2_on=f;
return 0;
};
a2_stopFirst=function(){a2_pause(true);a2_seekFrame(0);};
a2_stopLast=function(){a2_pause(true);a2_seekFrame(2);};
a2_gotoNext=function(){
if(a2_seekFrame(a2_idx+1)<0){
if(a2_playing){a2_seekFrame(a2_idx-1);a2_playLeft();}
return;
}
};
a2_gotoPrev=function(){
if(a2_seekFrame(a2_idx-1)<0){
if(a2_playing){a2_seekFrame(a2_idx+1);a2_playRight();}
return;
}
};
a2_pause=function(stop){
try{clearInterval(a2_int);}catch(e){}
a2_playing=false;
a2_isPaused=!stop;
a2_btnPauseLeft.setAttribute('visibility','hidden');
a2_btnPlayLeft.setAttribute('visibility','visible');
a2_btnPauseRight.setAttribute('visibility','hidden');
a2_btnPlayRight.setAttribute('visibility','visible');
};
a2_playRight=function(){
var tmp_int;
try{tmp_int=setInterval('a2_gotoNext()',1000/a2_fps/a2_spd);}catch(e){}
try{clearInterval(a2_int);}catch(e){}
a2_int=tmp_int;
a2_playsRight=true;
a2_playing=true;
a2_isPaused=false;
a2_btnPauseLeft.setAttribute('visibility','visible');
a2_btnPlayLeft.setAttribute('visibility','hidden');
a2_btnPauseRight.setAttribute('visibility','visible');
a2_btnPlayRight.setAttribute('visibility','hidden');
};
a2_playLeft=function(){
var tmp_int;
try{tmp_int=setInterval('a2_gotoPrev()',1000/a2_fps/a2_spd);}catch(e){}
try{clearInterval(a2_int);}catch(e){}
a2_int=tmp_int;
a2_playsRight=false;
a2_playing=true;
a2_isPaused=false;
a2_btnPauseLeft.setAttribute('visibility','visible');
a2_btnPlayLeft.setAttribute('visibility','hidden');
a2_btnPauseRight.setAttribute('visibility','visible');
a2_btnPlayRight.setAttribute('visibility','hidden');
};
a2_playPauseBwd=function(){if(a2_playing){a2_pause();}else{a2_playBwd();}};
a2_playPauseFwd=function(){if(a2_playing){a2_pause();}else{a2_playFwd();}};
a2_spdIncr=function(){a2_spd*=1.1;a2_setFps(a2_fps);};
a2_spdDecr=function(){a2_spd/=1.1;a2_setFps(a2_fps);};
a2_spdReset=function(){a2_spd=1;a2_setFps(a2_fps);};
a2_stepBwd=function(){if(!a2_playing){a2_seekFrame(a2_idx-1);a2_isPaused=true;}};
a2_stepFwd=function(){if(!a2_playing){a2_seekFrame(a2_idx+1);a2_isPaused=true;}};
a2_playBwd=function(){if(a2_idx==0||!a2_isPaused){a2_stopLast();}a2_playLeft();};
a2_playFwd=function(){if(a2_idx==2||!a2_isPaused){a2_stopFirst();}a2_playRight();};
a2_seekFrame(0);
}document.getElementById('anm2').addEventListener('mouseup',onMouseUpWdgt);
document.getElementById('anm2').addEventListener('mousedown',onMouseDownWdgt);
document.getElementById('anm2').addEventListener('touchend',onTouchEndWdgt);
document.getElementById('anm2').addEventListener('touchstart',onTouchStartWdgt);
document.getElementById('anm2').addEventListener('touchmove',onTouchMove);
onvisible();
}
function onvisible(){
}
function onhidden(){
if(a2_playing){a2_pause(true);}
if(!a2_isPaused)a2_playsRight=true;
if(!a2_isPaused&&a2_idx!=0)a2_seekFrame(0);
}
function onVisibilityChange(){
if(document.hidden){try{onhidden();}catch(e){}}else{try{onvisible();}catch(e){}}
}
document.addEventListener('visibilitychange',onVisibilityChange);
window.addEventListener('load',onload);
var permPause2=false; function onWidgetUpAction(event){
try{
if(!a2_isPaused)a2_stopFirst();
if(event.shiftKey)a2_playsRight=!a2_playsRight;
if(a2_idx==0)a2_playsRight=true;
if(a2_idx==2)a2_playsRight=false;
if(a2_playsRight){a2_playRight();}else{a2_playLeft();}
}catch(e){}
}
function onTouchStartWdgt(event){
event.preventDefault();
event.stopPropagation();
permPause2=false; try{if(a2_playing){a2_pause();}}catch(e){}
}
function onTouchEndWdgt(event){
event.preventDefault();
event.stopPropagation();
if(event.targetTouches.length>0){permPause2=true;}
else{
if(permPause2){permPause2=false;}
else{onWidgetUpAction(event);}
}
}
function onTouchMove(event){
event.preventDefault();
event.stopPropagation();
}
function onMouseDownWdgt(event){
event.preventDefault();
event.stopPropagation();
try{if(a2_playing){a2_pause();}}catch(e){}
}
function onMouseUpWdgt(event){
event.preventDefault();
event.stopPropagation();
onWidgetUpAction(event);
}
})();
